import React, { Component } from "react"

class TodoListItem extends Component {
  render() {
    return (
      <li>
        {props.todoItemName}
        <button value={props.todoItemId} onClick={props.delete.bind(this)}>
          Delete
        </button>
      </li>
    )
  }
}

export default TodoListItem
